INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (27, 2, "A", "獣人族", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "トゥインクルウィッシュ", 155, 100101, 8, 44, "東山奈央", "人助け、応援", "人助けが大好き！　前向き格闘娘", 0, "ヒヨリ", 16);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (5, 2, "O", "ヒューマン", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "トゥインクルウィッシュ", 158, 100201, 4, 47, "種田梨沙", "料理、人間観察", "戦闘のサポートが得意な、心優しい少女", 0, "ユイ", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (12, 2, "B", "魔族", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "トゥインクルウィッシュ", 163, 100301, 1, 46, "早見沙織", "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士", 0, "レイ", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (10, 5, "O", "ヒューマン", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "リトルリリカル", 128, 100401, 8, 27, "諸星すみれ", "いたずら、探検", "探検好きのイタズラっ子", 0, "ミソギ", 9);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (25, 8, "O", "獣人族", "？？？", "王宮騎士団（NIGHTMARE）", 146, 100501, 11, 40, "下田麻美", "ヒーローごっこ", "ヒーローに憧れる騎士見習いの少女", 0, "マツリ", 12);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (22, 7, "O", "魔族", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "悪魔偽王国軍（ディアボロス）", 150, 100601, 11, 42, "浅倉杏美", "サックス", "甘え上手なみんなの人気者", 0, "アカリ", 13);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (23, 7, "B", "魔族", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "悪魔偽王国軍（ディアボロス）", 130, 100701, 1, 32, "雨宮天", "プリンを食べること", "プリン大好きゴースト娘", 0, "ミヤコ", 14);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (10, 15, "AB", "エルフ", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ヴァイスフリューゲル　ランドソル支部", 150, 100801, 10, 40, "大空直美", "鏡で自分を見ること", "ボクは誰よりも美しい", 0, "ユキ", 14);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (5, 13, "A", "魔族", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "トワイライトキャラバン", 159, 100901, 7, 45, "髙野麻美", "小説執筆", "前世を信じる中二病患者、「疾風の冥姫」", 0, "アンナ", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (22, 10, "O", "獣人族", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "自警団（カォン）", 155, 101001, 9, 42, "内田真礼", "空想、ぬいぐるみ集め", "マホマホ王国のプリンセス", 0, "マホ", 16);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (25, 3, "A", "ヒューマン", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "ラビリンス", 156, 101101, 8, 44, "阿澄佳奈", "お裁縫", "人懐っこくてマシンガントークな妹系少女", 0, "リノ", 15);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (24, 6, "A", "エルフ", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "フォレスティエ", 156, 101201, 12, 46, "大橋彩香", "妹と遊ぶこと、二度寝、昼寝、早寝", "みんなのために超能力を使う眠り姫", 0, "ハツネ", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (21, 13, "O", "魔族", "", "トワイライトキャラバン", 166, 101301, 8, 55, "佳村はるか", "読書、魔法", "オタク全開な魔法少女", 0, "ナナカ", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 10, "AB", "獣人族", "test", "自警団（カォン）", 152, 101401, 11, 41, "水瀬いのり", "読書、推理", "頭脳明晰な美少女名探偵", 0, "カスミ", 15);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (5, 6, "O", "エルフ", "test", "フォレスティエ", 165, 101501, 9, 54, "國府田マリ子", "絵本作り", "母性溢れる優しいみんなの「ミサト先生」", 0, "ミサト", 21);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (10, 14, "O", "魔族", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "ルーセント学院", 167, 101601, 4, 48, "上坂すみれ", "ファッション", "天真爛漫で人気者のカリスマモデル", 0, "スズナ", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (7, 10, "A", "獣人族", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "自警団（カォン）", 158, 101701, 7, 53, "高森奈津美", "踊り、空手", "いつでも「なんくるないさ～」な天然娘", 0, "カオリ", 19);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (14, 14, "B", "魔族", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "ルーセント学院", 162, 101801, 8, 52, "伊藤静", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "多くの男性を魅了する無垢な女教師", 0, "イオ", 23);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 5, "O", "獣人族", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "リトルリリカル", 117, 102001, 4, 21, "日高里菜", "かわいいもの集め", "お歌もにんじんも、ウサギさんも大好き♪", 0, "ミミ", 10);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (9, 9, "B", "ヒューマン", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "サレンディア救護院", 150, 102101, 6, 40, "植田佳奈", "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子", 0, "クルミ", 12);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (22, 7, "O", "魔族", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "悪魔偽王国軍（ディアボロス）", 150, 102201, 11, 40, "原紗友里", "ゲーム全般", "人見知りであまのじゃくな女の子", 0, "ヨリ", 13);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (10, 9, "B", "ヒューマン", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "サレンディア救護院", 148, 102301, 5, 38, "芹澤優", "屋内でできる遊び", "ぷうきちといつも一緒！", 0, "アヤネ", 14);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (12, 9, "O", "ヒューマン", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "サレンディア救護院", 154, 102501, 12, 43, "悠木碧", "ご奉仕", "お嬢さまのためにがんばるドジっ娘メイド", 0, "スズメ", 15);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (1, 11, "B", "獣人族", "test", "牧場（エリザベスパーク）", 144, 102601, 1, 42, "小岩井ことり", "あんパン", "遊びと睡眠が何より大事なぐうたら娘", 0, "リン", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (30, 13, "B", "魔族", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "トワイライトキャラバン", 154, 102701, 7, 43, "橋本ちなみ", "実験、裁縫、料理", "運命の相手に一途すぎる乙女", 0, "エリコ", 16);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (4, 9, "A", "エルフ", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "サレンディア救護院", 156, 102801, 10, 43, "堀江由衣", "経営、お茶会", "救護院を経営する優しい庶民派お嬢様", 0, "サレン", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (24, 4, "B", "ヒューマン", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "カルミナ", 157, 102901, 1, 40, "日笠陽子", "舞台鑑賞、ダンス", "歌って踊れる大人気アイドル", 0, "ノゾミ", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (31, 15, "O", "ヒューマン", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ヴァイスフリューゲル　ランドソル支部", 163, 103001, 8, 51, "佐藤聡美", "忍法開発", "トーゴクの神秘、オシエテクダサイ！", 0, "ニノン", 16);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (22, 7, "AB", "魔族", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "悪魔偽王国軍（ディアボロス）", 157, 103101, 12, 42, "大坪由佳", "占い", "占いが得意な霊能少女", 0, "シノブ", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (12, 12, "AB", "ヒューマン", "この私とともにいる限り、\nお金に不自由はさせませんわ！", "メルクリウス財団", 157, 103201, 3, 45, "松嵜麗", "慈善事業", "一人前の商人を目指すパワフルお嬢様", 0, "アキノ", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 11, "B", "ヒューマン", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "牧場（エリザベスパーク）", 142, 103301, 3, 35, "新田恵海", "漫才", "みんなを笑顔にするお笑い牧場主", 0, "マヒル", 20);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (16, 12, "A", "エルフ", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "メルクリウス財団", 164, 103401, 3, 55, "今井麻美", "ウインドーショッピング", "純情でほっとけない大人の女性", 0, "ユカリ", 22);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (2, 5, "A", "エルフ", "test", "リトルリリカル", 118, 103601, 2, 21, "小倉唯", "お勉強", "礼儀正しくしっかり者のちびっ子優等生", 0, "キョウカ", 8);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (11, 8, "A", "ヒューマン", "test", "王宮騎士団（NIGHTMARE）", 149, 103701, 8, 43, "茅原実里", "剣術、年長者をからかう", "義理堅くてからかい好きな剣術少女", 0, "トモ", 13);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 11, "A", "獣人族", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "牧場（エリザベスパーク）", 153, 103801, 11, 40, "小清水亜美", "読書、お散歩", "読書が趣味の病弱少女", 0, "シオリ", 14);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (6, 6, "AB", "エルフ", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "フォレスティエ", 158, 104001, 6, 44, "花澤香菜", "友達作りのイメトレ", "「友達」に憧れる、エルフの森の女の子", 0, "アオイ", 13);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 4, "O", "ヒューマン", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "カルミナ", 163, 104201, 6, 46, "福原綾香", "各種楽器", "人々を守るために歌う、唱喚士の少女", 0, "チカ", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (9, 10, "O", "獣人族", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "自警団（カォン）", 168, 104301, 8, 54, "小松未可子", "お菓子作り", "男勝りで情に厚いワイルド娘", 0, "マコト", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (5, 7, "A", "魔族", "test", "悪魔偽王国軍（ディアボロス）", 172, 104401, 5, 50, "丹下桜", "世界征服", "かつては夜を支配した最強の吸血鬼", 0, "イリヤ", "??");
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (19, 15, "AB", "ヒューマン", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "ヴァイスフリューゲル　ランドソル支部", 157, 104501, 11, 49, "長妻樹里", "小説を読むこと", "妄想大好き！　ほんとは照れ屋な女の子", 0, "クウカ", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (1, 12, "AB", "獣人族", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "メルクリウス財団", 158, 104601, 3, 48, "沼倉愛美", "猫とたわむれること", "弱きを助け強きをくじく猫娘", 0, "タマキ", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (25, 8, "A", "ヒューマン", "？？？", "王宮騎士団（NIGHTMARE）", 171, 104701, 10, 50, "川澄綾子", "格闘技、湯浴み", "素顔を見せない冷静沈着な女性騎士", 0, "ジュン", 25);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (11, 12, "O", "ヒューマン", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "メルクリウス財団", 163, 104801, 11, 49, "田所あずさ", "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女", 0, "ミフユ", 20);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (24, 3, "O", "ヒューマン", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "ラビリンス", 168, 104901, 10, 54, "生天目仁美", "家事全般", "お姉ちゃんがお世話してあげるからねっ！", 0, "シズル", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 14, "A", "魔族", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ルーセント学院", 120, 105001, 1, 22, "久野美咲", "ファッション誌鑑賞、コスメ集め", "ちょっとおませな恋に恋する女の子", 0, "ミサキ", 11);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (7, 13, "A", "ヒューマン", "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "トワイライトキャラバン", 166, 105101, 3, 53, "三石琴乃", "研究、実験", "実験が趣味の危険な科学者", 0, "ミツキ", 27);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (14, 11, "A", "獣人族", "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "牧場（エリザベスパーク）", 150, 105201, 3, 100, "徳井青空", "毛繕い、お喋り", "乙女チックなもふもふアニマル", 0, "リマ", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (28, 15, "A", "ヒューマン", "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "ヴァイスフリューゲル　ランドソル支部", 140, 105301, 7, 33, "辻あゆみ", "お菓子屋通い", "見た目も中身もお子ちゃまな異国の軍人", 0, "モニカ", 18);
