INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (10, "", "O", "ヒューマン", "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", "？？？", 156, 105701, 3, 45, "金元寿子", "冒険、おしゃべり", "空への冒険を夢見る騎空士の少女", 0, "ジータ", 17);
