INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (12, 9, "O", "ヒューマン", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "サレンディア救護院", 154, 107701, 12, 43, "悠木碧", "ご奉仕", "お嬢さまのためにがんばるドジっ娘メイド", 0, "スズメ（サマー）", 15);
