INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (1, 12, "AB", "獣人族", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "メルクリウス財団", 158, 107901, 3, 48, "沼倉愛美", "猫とたわむれること", "弱きを助け強きをくじく猫娘", 0, "タマキ（サマー）", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (11, 12, "O", "ヒューマン", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "メルクリウス財団", 163, 108001, 11, 49, "田所あずさ", "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女", 0, "ミフユ（サマー）", 20);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (22, 7, "AB", "魔族", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "悪魔偽王国軍（ディアボロス）", 157, 108101, 12, 42, "大坪由佳", "占い", "占いが得意な霊能少女", 0, "シノブ（ハロウィン）", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (23, 7, "B", "魔族", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "悪魔偽王国軍（ディアボロス）", 130, 108201, 1, 32, "雨宮天", "プリンを食べること", "プリン大好きゴースト娘", 0, "ミヤコ（ハロウィン）", 14);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 14, "A", "魔族", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ルーセント学院", 120, 108301, 1, 22, "久野美咲", "ファッション誌鑑賞、コスメ集め", "ちょっとおませな恋に恋する女の子", 0, "ミサキ（ハロウィン）", 11);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, 4, "O", "ヒューマン", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "カルミナ", 163, 108401, 6, 46, "福原綾香", "各種楽器", "人々を守るために歌う、唱喚士の少女", 0, "チカ（クリスマス）", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (9, 9, "B", "ヒューマン", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "サレンディア救護院", 150, 108501, 6, 40, "植田佳奈", "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子", 0, "クルミ（クリスマス）", 12);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (10, 9, "B", "ヒューマン", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "サレンディア救護院", 148, 108601, 5, 38, "芹澤優", "屋内でできる遊び", "ぷうきちといつも一緒！", 0, "アヤネ（クリスマス）", 14);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (27, 2, "A", "獣人族", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "トゥインクルウィッシュ", 155, 108701, 8, 44, "東山奈央", "人助け、応援", "人助けが大好き！　前向き格闘娘", 0, "ヒヨリ（ニューイヤー）", 16);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (5, 2, "O", "ヒューマン", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "トゥインクルウィッシュ", 158, 108801, 4, 47, "種田梨沙", "料理、人間観察", "戦闘のサポートが得意な、心優しい少女", 0, "ユイ（ニューイヤー）", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (12, 2, "B", "魔族", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "トゥインクルウィッシュ", 163, 108901, 1, 46, "早見沙織", "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士", 0, "レイ（ニューイヤー）", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (30, 13, "B", "魔族", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "トワイライトキャラバン", 154, 109001, 7, 43, "橋本ちなみ", "実験、裁縫、料理", "運命の相手に一途すぎる乙女", 0, "エリコ（バレンタイン）", 16);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (24, 3, "O", "ヒューマン", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "ラビリンス", 168, 109101, 10, 54, "生天目仁美", "家事全般", "お姉ちゃんがお世話してあげるからねっ！", 0, "シズル（バレンタイン）", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (1, "", "AB", "ヒューマン", "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "？？？", 156, 109201, 12, 55, "日笠陽子", "読書", "英霊と契約を結んだマナリアの天才王女", 0, "アン", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (4, "", "O", "ヒューマン", "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "？？？", 144, 109301, 2, 45, "こやまきみこ", "食べること、眠ること", "マナリア魔法学院の新入生", 0, "ルゥ", 15);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (3, "", "B", "半人半竜", "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "？？？", 167, 109401, 11, 67, "福原綾香", "ピアノ", "人を超越した力を有す心優しい竜姫", 0, "グレア", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES (19, 15, "AB", "ヒューマン", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "ヴァイスフリューゲル　ランドソル支部", 157, 109501, 11, 49, "長妻樹里", "小説を読むこと", "妄想大好き！　ほんとは照れ屋な女の子", 0, "クウカ（オーエド）", 18);
